css:
atom-text-editor,
atom-text-editor[mini],
atom-text-editor[mini]::shadow,
:host {
  -webkit-font-smoothing: antialiased;
}
atom-text-editor,
:host {
  background-color: #20222c;
  color: #d4d5d8;
}
atom-text-editor .line.cursor-line,
:host .line.cursor-line {
  background-color: rgba(255, 255, 255, 0.03);
  transition: all 0.2s;
}
atom-text-editor .invisible,
:host .invisible {
  color: #d4d5d8;
}
atom-text-editor .cursor,
:host .cursor {
  border-left: 2px solid #526fff;
}
atom-text-editor .selection .region,
:host .selection .region {
  background-color: #35394a;
}
atom-text-editor .bracket-matcher .region,
:host .bracket-matcher .region {
  border-bottom: 1px solid #526fff;
  box-sizing: border-box;
}
atom-text-editor .invisible-character,
:host .invisible-character {
  color: rgba(212, 213, 216, 0.15);
}
atom-text-editor .indent-guide,
:host .indent-guide {
  color: rgba(212, 213, 216, 0.15);
}
atom-text-editor .wrap-guide,
:host .wrap-guide {
  background-color: rgba(212, 213, 216, 0.15);
}
atom-text-editor .gutter .line-number,
:host .gutter .line-number {
  color: #8f9099;
  padding-left: 10px;
  border-left: 2px solid transparent;
  -webkit-font-smoothing: antialiased;
}
atom-text-editor .gutter .line-number.cursor-line,
:host .gutter .line-number.cursor-line {
  color: #d4d5d8;
  background-color: rgba(255, 255, 255, 0.03);
  border-left: 2px solid #008aff;
  transition: all 0.2s;
}
atom-text-editor .gutter .line-number .icon-right,
:host .gutter .line-number .icon-right {
  color: #d4d5d8;
}
atom-text-editor .gutter:not(.git-diff-icon) .line-number.git-line-removed.git-line-removed::before,
:host .gutter:not(.git-diff-icon) .line-number.git-line-removed.git-line-removed::before {
  bottom: -3px;
}
atom-text-editor .gutter:not(.git-diff-icon) .line-number.git-line-removed::after,
:host .gutter:not(.git-diff-icon) .line-number.git-line-removed::after {
  content: "";
  position: absolute;
  left: 0px;
  bottom: 0px;
  width: 25px;
  border-bottom: 1px dotted rgba(218, 72, 54, 0.5);
  pointer-events: none;
}
atom-text-editor .gutter .line-number.folded,
:host .gutter .line-number.folded,
atom-text-editor .gutter .line-number:after,
:host .gutter .line-number:after,
atom-text-editor .fold-marker:after,
:host .fold-marker:after {
  color: #d4d5d8;
}
.comment {
  color: #5c5f70;
  font-style: italic;
}
.entity.name.type {
  color: #ffee44;
}
.entity.other.inherited-class {
  color: #6dba09;
}
.keyword {
  color: #db84f4;
}
.keyword.control {
  color: #db84f4;
}
.keyword.operator {
  color: #d4d5d8;
}
.keyword.other.special-method {
  color: #008aff;
}
.keyword.other.unit {
  color: #6dba09;
}
.storage {
  color: #db84f4;
}
.storage.type {
  color: #ff4c98;
}
.storage.type.annotation,
.storage.type.primitive {
  color: #db84f4;
}
.storage.modifier.package,
.storage.modifier.import {
  color: #d4d5d8;
}
.constant {
  color: #ffa500;
}
.constant.variable {
  color: #bb3322;
}
.constant.character.escape {
  color: #00bfff;
}
.constant.numeric {
  color: #00bfff;
}
.constant.other.color {
  color: #00bfff;
}
.constant.other.symbol {
  color: #00bfff;
}
.variable {
  color: #ffa500;
}
.variable.interpolation {
  color: #ff4c98;
}
.variable.parameter {
  color: #d4d5d8;
}
.variable.property {
  color: #ff4c98;
}
.variable.this {
  color: #ffee44;
}
.string {
  color: #008aff;
}
.string.regexp {
  color: #6dba09;
}
.string .source.embedded {
  color: #ffa500;
}
.string .quasi {
  color: #ff4c98;
}
.string.unquoted {
  color: #8877ff;
}
.string.other.link {
  color: #bb3322;
}
.punctuation.definition.comment {
  color: #5c5f70;
}
.punctuation.definition.method-parameters,
.punctuation.definition.function-parameters,
.punctuation.definition.parameters,
.punctuation.definition.separator,
.punctuation.definition.seperator,
.punctuation.definition.array {
  color: #d4d5d8;
}
.punctuation.definition.heading,
.punctuation.definition.identity {
  color: #008aff;
}
.punctuation.definition.bold {
  color: #ffee44;
  font-weight: bold;
}
.punctuation.definition.italic {
  color: #db84f4;
  font-style: italic;
}
.punctuation.definition.tag {
  color: #008aff;
}
.punctuation.section.embedded {
  color: #ff4c98;
}
.punctuation.section.method,
.punctuation.section.class,
.punctuation.section.inner-class {
  color: #d4d5d8;
}
.support.class {
  color: #ffee44;
}
.support.type {
  color: #00bfff;
}
.support.property-name {
  color: #db84f4;
}
.support.property-value {
  color: #ee2211;
}
.support.function {
  color: #00bfff;
}
.support.function.any-method {
  color: #008aff;
}
.entity.name.function {
  color: #db84f4;
}
.entity.name.method {
  color: #6dba09;
}
.entity.name.class,
.entity.name.type.class {
  color: #ffee44;
}
.entity.name.section {
  color: #008aff;
}
.entity.name.tag {
  color: #00bfff;
}
.entity.other.attribute-name {
  color: #00bfff;
}
.entity.other.attribute-name.id {
  color: #008aff;
}
.entity.other.attribute-name.pseudo-element {
  color: #8877ff;
}
.meta.class {
  color: #ffee44;
}
.meta.class.body {
  color: #d4d5d8;
}
.meta.method-call,
.meta.method {
  color: #6dba09;
}
.meta.definition.variable {
  color: #bb3322;
}
.meta.link {
  color: #ffa500;
}
.meta.require {
  color: #008aff;
}
.meta.selector {
  color: #db84f4;
}
.meta.separator {
  background-color: #373b41;
  color: #d4d5d8;
}
.meta.tag {
  color: #d4d5d8;
}
.meta.curly {
  color: #d4d5d8;
}
.none {
  color: #d4d5d8;
}
.invalid.deprecated {
  color: #1a1100 !important;
  background-color: #ffae1a !important;
}
.invalid.illegal {
  color: #ffffff !important;
  background-color: #da4836 !important;
}
.markup.bold {
  color: #ffa500;
  font-weight: bold;
}
.markup.changed {
  color: #db84f4;
}
.markup.deleted {
  color: #bb3322;
}
.markup.italic {
  color: #db84f4;
  font-style: italic;
}
.markup.heading {
  color: #bb3322;
}
.markup.heading .punctuation.definition.heading {
  color: #008aff;
}
.markup.link {
  color: #db84f4;
}
.markup.inserted {
  color: #6dba09;
}
.markup.quote {
  color: #ffa500;
}
.markup.raw {
  color: #6dba09;
}
.bracket-matcher .region {
  border-bottom: 1px solid #008aff;
  margin-top: 2px;
}
#linter-inline linter-message {
  font-family: "PT Sans", sans-serif;
  font-size: 16px;
}
linter-panel linter-message {
  font-size: 14px;
}
.gutter .git-line-added,
.gutter .git-line-modified {
  padding-left: 8px !important;
}
.source.cs .keyword.operator {
  color: #db84f4;
}
.source.cs .meta.keyword.using {
  color: #d4d7d6;
}
.source.cs .method.body {
  color: #d4d7d6;
}
.source.cs .meta.method-call {
  color: #d4d7d6;
}
.source.gfm .markup {
  -webkit-font-smoothing: auto;
}
.source.gfm .link .entity {
  color: #008aff;
}
.source.ini .keyword.other.definition.ini {
  color: #bb3322;
}
.source.java .storage.modifier.import {
  color: #ffee44;
}
.source.java .storage.type {
  color: #ffee44;
}
.source.java-properties .meta.key-pair {
  color: #bb3322;
}
.source.java-properties .meta.key-pair > .punctuation {
  color: #d4d5d8;
}
.source.json .meta.structure.dictionary.json > .string.quoted.json {
  color: #bb3322;
}
.source.json .meta.structure.dictionary.json > .string.quoted.json > .punctuation.string {
  color: #bb3322;
}
.source.json .meta.structure.dictionary.json > .value.json > .string.quoted.json,
.source.json .meta.structure.array.json > .value.json > .string.quoted.json,
.source.json .meta.structure.dictionary.json > .value.json > .string.quoted.json > .punctuation,
.source.json .meta.structure.array.json > .value.json > .string.quoted.json > .punctuation {
  color: #6dba09;
}
.source.json .meta.structure.dictionary.json > .constant.language.json,
.source.json .meta.structure.array.json > .constant.language.json {
  color: #00bfff;
}
.source.ruby .constant.other.symbol > .punctuation {
  color: inherit;
}
.source.python .keyword.operator.logical.python {
  color: #db84f4;
}
.source.python .variable.parameter {
  color: #ffa500;
}
